import React from 'react';
import './HeroPhone.css';
import phoneImage from '../assets/logo.png';
import phoneImage2 from '../assets/logo2.png';

const HeroPhone = () => {
  return (
    <div className="card">
      <div className="btn1"></div>
      <div className="btn2"></div>
      <div className="btn3"></div>
      <div className="btn4"></div>

      <div className="hover-image-container">
  <div className="hover-transition-box">
    <img src={topImage} alt="Hover Image" className="hover-img" />
    <span className="hover-text">Join</span>
  </div>

  <img src={bottomImage} alt="Bottom Companion" className="pho" />
</div>


      <div className="top">
        <div className="camera">
          <div className="int"></div>
        </div>
        <div className="speaker"></div>
      </div>
    </div>
  );
};

export default HeroPhone;
